pragma solidity ^0.8.0;

contract PizzaDeliveryChoreography {
    enum TokenState {
        Start,
        OrderPizza,
        ConfirmETA,
        AnnounceDelivery,
        DeliverPizza,
        End
    }

    TokenState public tokenstate;
    address public customer;
    address public pizzaPlace;
    address public deliveryBoy;

    constructor(address _customer, address _pizzaPlace, address _deliveryBoy) {
        customer = _customer;
        pizzaPlace = _pizzaPlace;
        deliveryBoy = _deliveryBoy;
        tokenstate = TokenState.Start;
    }

    function enact(uint taskID) external {
        require(msg.sender == getParticipant(tokenstate), "Only the correct participant can enact this task.");

        if (tokenstate == TokenState.Start && taskID == 1) {
            tokenstate = TokenState.OrderPizza;
        } else if (tokenstate == TokenState.OrderPizza && taskID == 2) {
            tokenstate = TokenState.ConfirmETA;
        } else if (tokenstate == TokenState.ConfirmETA && taskID == 3) {
            tokenstate = TokenState.AnnounceDelivery;
        } else if (tokenstate == TokenState.AnnounceDelivery && taskID == 4) {
            tokenstate = TokenState.DeliverPizza;
        } else if (tokenstate == TokenState.DeliverPizza && taskID == 5) {
            tokenstate = TokenState.End;
        } else {
            revert("Invalid task ID for current state.");
        }
    }

    function getParticipant(TokenState state) internal view returns (address) {
        if (state == TokenState.OrderPizza || state == TokenState.ConfirmETA || state == TokenState.AnnounceDelivery) {
            return customer;
        } else if (state == TokenState.DeliverPizza) {
            return deliveryBoy;
        } else if (state == TokenState.Start || state == TokenState.End) {
            return address(0);
        } else {
            return pizzaPlace;
        }
    }
}
